import { withStyles } from "@material-ui/core/styles";

export default withStyles(theme => {
  const colors = theme.palette.colors;

  return {
    container: {
      width: "100vw"
    },
    logoContainer: {
      display: "flex",
      flexDirection: "row",
      padding: 5
    },
    logo: {
      fontSize: "55px",
      "&:hover": {
        cursor: "pointer",
        color: colors.main50
      }
    },
    siteLinks: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center"
    },
    socialLinks: {
      display: "flex",
      justifyContent: "flex-end",
      alignItems: "center"
    },
    link: {
      color: "#85b6e0",
      textDecoration: "none",
      marginRight: 30,
      fontSize: "18px",
      "&:hover": {
        cursor: "pointer",
        color: colors.main50
      }
    },
    svgIcon: {
      fill: "#85b6e0"
    }
  };
});
